import { Component } from "react";

class Breed extends Component {
  state = {
    type: 0,
  };

  catClick = () => {
    this.setState({
      type: 1,
    });
  };

  dogClick = () => {
    this.setState({
      type: 2,
    });
  };

  render() {
    return <h1>{this.state.type}</h1>;
  }
}

export default Breed;
